import React, { Component } from 'react'
import Areas from '../areas/Areas'

export default class Dashboard extends Component {
    render() {
        return (
            <div className="dashboard container">
                <div className="row">
                    <div className="col s12 m6">
                        <Areas/>
                    </div>
                </div>
            </div>
        )
    }
}
